import React,{useEffect} from 'react';
import { useSelector, useDispatch } from 'react-redux';

import * as actions from '../actions';
import { thunkSendMessage, planetsApi, VehiclesApi, GetTokenFromApi } from '../actions/thunkActions';
import logo from '../logo.svg';
import './App.css';
import { State } from '../reducers';
// import thunkSendMessage from '../actions/thunkActions'

const App = () => {
  useEffect(() =>{
    dispatch(GetTokenFromApi())
    dispatch(planetsApi())
    dispatch(VehiclesApi())
  },[]
  )
  const message = useSelector((state: State) => state.message);
  const id = useSelector((state: State) => state.id);
  const planet=useSelector((state:State) => state.planet);
  const vehicle=useSelector((state:State) => state.vehicle);
  const dispatch = useDispatch();

  const onClick = () => {
    dispatch(actions.sampleAction2(id + 1));
    dispatch(thunkSendMessage('hello'));
  };
  return (
    <div className="App">
      <header className="App-header">
        message:
        {' '}
        {message}
        <img src={logo} className="App-logo" alt="logo" />
        id:
        {' '}
        {id}
        <button type="button" onClick={onClick}>
          increment id
        </button>
        <div className='row'>
        <div className='col-sm'>
        <div className='form-group'>
        <select className='form-control' id='exampleFormControlSelect1'>
          <option> </option>
          {planet.map(planets =>  
          <option>{planets.name} {planets.distance}</option>
          )}
        </select>
      </div>
          </div>
        <div className='col-sm'>One of three columns</div>
        <div className='col-sm'>One of three columns</div>
      </div>

  {planet.map(planets => <h1>{planets.name} {planets.distance}</h1> )}
  {vehicle.map(planets => <h1>{planets.name} {planets.total_no} {planets.max_distance} {planets.speed} </h1> )}
      </header>
    </div>
  );
};

export default App;
